/*:
 * @target MZ
 * @author MelekTaus (Tausi)
 * @plugindesc [Version 0.1.2]
 *
 * @param Show Overlay
 * @type boolean
 * @default true
 *
 * @param Add to Title Menu
 * @type boolean
 * @default false
 *
 * @param Update Map Interpreter in Editor
 * @type boolean
 * @default false
 *
 * @param Remote Version URL
 * @type text
 * @default https://raw.githubusercontent.com/themelektaus/rpgmz-lighting-plugin/refs/heads/main/tausi-lighting/version.txt
 *
 * @param Remote Plugin URL
 * @type text
 * @default https://raw.githubusercontent.com/themelektaus/rpgmz-lighting-plugin/refs/heads/main/js/plugins/TausiLighting.js
 *
 * @help Simple Lighting System with a WYSIWYG-Editor
 *
 */

TAUSI_LIGHTING_LOCAL_VERSION = "0.1.2";
TAUSI_LIGHTING_README = "";
TAUSI_LIGHTING_PUBLISHER_MODE = false;

$dataLighting = null;

(async () =>
{
    try
    {
        const fs = require(`fs`)
        
        if (!fs.existsSync(`data/Lighting.json`))
        {
            fs.writeFileSync(`data/Lighting.json`, `{"version":1,"maps":[]}`)
        }
        
        unpackFolder(
            "",
            `.`
        )
    }
    catch
    {
        
    }
    
    let urls
    
    try
    {
        const fs = require(`fs`)
        try { fs.unlinkSync(`tausi-lighting/classes/3_Data_Lighting_GlobalLight.js`) } catch { }
        const files = fs.readdirSync(`tausi-lighting/classes`)
        urls = files.map(x => `tausi-lighting/classes/${x}`)
        fs.writeFileSync(`tausi-lighting/classes.json`, JSON.stringify(urls))
    }
    catch
    {
        urls = await fetch(`tausi-lighting/classes.json`)
            .then(x => x.json())
            .catch(() => { })
    }
    
    if (!urls)
    {
        if (!location.pathname.endsWith(`/tausi-lighting/editor/index.html`))
        {
            location.href = `tausi-lighting/editor/index.html`
        }
        
        return
    }
    
    urls.unshift(`tausi-lighting/perlin.js`)
    urls.unshift(`tausi-lighting/showdown.min.js`)
    
    await new Promise(resolve =>
    {
        let loadCount = 0
        
        for (const url of urls)
        {
            const script = document.createElement(`script`)
            script.src = url
            script.async = false
            script.onerror = () => console.error(`Failed to load`, url)
            script.onload = () =>
            {
                if (++loadCount == urls.length)
                {
                    resolve()
                }
            }
            document.body.appendChild(script)
        }
    })
    
    function unpackFolder(base64String, outputPath)
    {
        const fs = require(`fs`)
        const path = require(`path`)
        
        const structure = JSON.parse(Buffer.from(base64String, `base64`).toString())
        
        Object.entries(structure).forEach(([filePath, content]) =>
        {
            const fullPath = path.join(outputPath, filePath)
            fs.mkdirSync(path.dirname(fullPath), { recursive: true })
            fs.writeFileSync(fullPath, Buffer.from(content, `base64`))
        })
    }
})();